import React from 'react';
import TableHeader from './components/TableHeader';
import TableBody from './components/TableBody';
import ApiProvider from './context/ApiProvider';

function App() {
  return (
    <section>
      <ApiProvider>
        <TableHeader />
        <TableBody />
      </ApiProvider>
    </section>
  );
}

export default App;
